import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/SubmittedCodesPage.css';

function SubmittedCodesPage() {
  const navigate = useNavigate();
  const [codes] = useState([
    { id: 1, title: 'Example Code 1', code: 'console.log("Hello, world!");' },
    // Puedes agregar más códigos aquí
  ]);

  const handleViewDetails = (codeId) => {
    navigate(`/code-details/${codeId}`);
  };

  return (
    <div className="container">
      <h1>Submitted Codes</h1>
      <div className="codes-list">
        {codes.map((code) => (
          <div key={code.id} className="code-item" onClick={() => handleViewDetails(code.id)}>
            <h2>Title: {code.title}</h2>
            <pre>{code.code}</pre>
          </div>
        ))}
      </div>
      <button onClick={() => navigate('/blog')}>Back to Submit</button>
    </div>
  );
}

export default SubmittedCodesPage;
